
/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function(s) {
    if (!s) {
        return 0;
    }

    let maxLength = 0;
    let chWithPosAndNextPosArray = s.split('').map((ch, idx, arr) => [ch, arr.indexOf(ch, idx + 1), idx]);
    for (let i = 0, len = chWithPosAndNextPosArray.length; i < len; i++) {
        let [ch, next, idx] = chWithPosAndNextPosArray[i];

        // max length potentially not longer than next self or end of string
        let end = next > 0 ? next : len;
        // interest in those charcter within potential max with next self also within potential max
        // let ins = chWithPosAndNextPosArray.filter(([c, n], i) => i > idx && i < end && n > idx && n < end).sort((a, b) => a[1] - b[1]);
        let ins = [];
        for (let j = idx + 1; j < end; j++) {
            if (chWithPosAndNextPosArray[j][1] < end && chWithPosAndNextPosArray[j][1] > j) {
                ins.push(chWithPosAndNextPosArray[j]);
            }
        }

        // .map(([c, n]) => n);
        // Math.min(ins) <= will not work! it returns NaN
        // Math.min.apply(null, ins);
        if (ins.length) {
            ins = ins.sort((a, b) => a[1] - b[1]);
            end = ins[0][1];
            // start search from the next of duplicated char (will have i++ on top of loop)
            i = ins[0][2];
            // console.log(">>> ", i, new Date() - start);
        } 
        // else if (next > 0) {
            // although there is no duplicate within, however the character duplicte itself
            // start from next duplicat + 1
            // i = next;
        // }

        let maxChLen = end - idx;
        if (maxChLen > maxLength) { maxLength = maxChLen; }
        // console.log(i, maxLength, new Date() - start);
    }
    
    return maxLength;
}


